text.76:
Ante el evento climatológico, la ANDE inicia el protocolo:

:yellow_circle:Código Amarillo: 20 cuadrillas con vehículos, equipos y herramientas;
:orange_circle:Código Naranja: 30 cuadrillas, con vehículos, equipos y herramientas;
:red_circle:Código Rojo: 50 cuadrillas, con vehículos, equipos y herramientas.
